import React from 'react';
import Form from 'react-bootstrap/Form'; 
// import Button from 'react-bootstrap/Button';

export default function Login() {
  return (
    <>
    <div className='Container mt-3 mx-5'>
        <h3>Sign Up</h3>
        <div className="my-4">
            <Form>
                <Form.Group className="mb-3 col-5" controlId="forname">
                    <Form.Control type="text" placeholder="Enter your name"/>
                </Form.Group>
                <Form.Group className="mb-3 col-5" controlId="foremail">
                    <Form.Control type="email" placeholder="Enter your email"/>
                </Form.Group>
                <Form.Group className="mb-3 col-5" controlId="forpassword">
                    <Form.Control type="password" placeholder="Enter your name"/>
                </Form.Group>
            </Form>
        </div>
    </div>    
    </>
  )
}
